import React from 'react';
export default{
    RenderRow:(props)=>{
        return props.keys.map((key, index)=>{
        return <td key={props.data[key]}><b>{props.data[key]}</b></td>
        })
       },

    RenderProgressRow:(props) =>{
        return props.keys.map((key, index)=>{
            if(typeof props.data[key] == 'string'){
                return <td key={props.data[key]}><b>{props.data[key]}</b></td>
            }
            if(typeof props.data[key] != 'string'){
                if(key == 'issue_count') {
                    let bar = props.data[key] * 100 / props.item.issueCountSum;
                    bar = bar.toFixed(2);
                    return <td key={props.data[key]}><b>{props.data[key]}</b>
             <div class="progress">
                    <div class="inside" style={{width:`${bar}`+'px'}}>p</div>                  
                     </div><b></b>
                   </td>
                }


                    if(key == 'story_point') {
                        let bar = props.data[key] * 100 / props.item.storyPointSum;
                        bar = bar.toFixed(2);
                        return <td key={props.data[key]}><b>{props.data[key]}</b>
                 <div class="progress">
                        <div class="inside" style={{width:`${bar}`+'px'}}>p</div>                  
                         </div><b></b>
                       </td>
                    }



            }


            if(typeof props.data[key] != 'string'){
                if(key == 'story_point') {
                    let bar = props.data[key] * 100 / props.item.storyPointSum;
                    bar = bar.toFixed(2);
                    return <td key={props.data[key]}><b>{props.data[key]}</b>
             <div class="progress">
                    <div class="inside" style={{width:`${bar}`+'px'}}>p</div>                  
                     </div><b></b>
                   </td>
                }

            }

            if(typeof props.data[key] != 'string'){
                if(key == 'story_point') {
                    let bar = props.data[key] * 100 / props.item.storyPointSum;
                    bar = bar.toFixed(2);
                    return <td key={props.data[key]}><b>{props.data[key]}</b>
             <div class="progress">
                    <div class="inside" style={{width:`${bar}`+'px'}}>p</div>                  
                     </div><b></b>
                   </td>
                }

            }




            })
           }
    }

